import React from "react";
import Login from "../Login/Login";

function Nav(props) {
  return (


    
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
   
      </a>
      <Login
        user={props.user}
        onLogin={props.onLogin}
        onLogout={props.onLogout}
      />
    </nav>
  );
}

export default Nav;
